export const notoserifdevnagariextrabold=""
export const loadDevanagariFont = (doc) => {
    if (!doc) return;

    doc.addFileToVFS("NotoSerifDevanagari_ExtraCondensed-Bold.ttf",notoserifdevnagariextrabold);
    doc.addFont("NotoSerifDevanagari_ExtraCondensed-Bold.ttf", "NotoSerifDevanagari_ExtraCondensed-Bold", "normal");
};
